import React, { Component } from 'react';

const initialState = {
    login: true,
    username: '',
    password: '',
    email: ''
}
type LoginState = {
    login: boolean,
    username: string,
    password: string,
    email: string
}

export default class Login extends Component<{}, LoginState> {
    readonly state: LoginState = initialState

    componentDidMount() {
    }

    toggleLogin() {
        this.setState({login: !this.state.login})
    }

    render() {
        return (
            <div>
                <h1>{this.state.login ? 'Login' : 'Register'}</h1>
                <button onClick={() => this.toggleLogin()}>{this.state.login ? 'Register' : 'Login'}</button>
            </div>
        )
    }
}
